  return 
}


function ExerciseGrid() {

  const [list, setList] = useState([]);
  useEffect(()=>{
    fetch('http://localhost:3000/workouts')
      .then(response => response.json())
      .then(setList);
  }, []);

  return (
    <div className="ExerciseGrid">
         <DataGrid columns={columns} rows={rows} />;
    </div>
  );
}

export default ExerciseGrid;
